
  StateGraph = function(operation, before, after) {
    var lastAfter, lastBefore, list;
    list = [];
    before = after = operation;
    lastBefore = lastAfter = operation;
    while (before = before.$before) {
      if (before.$after !== lastBefore) {
        throw 'List is broken';
      }
      list.unshift(before);
      lastBefore = before;
    }
    list.push(operation);
    while (after = after.$after) {
      if (after.$before !== lastAfter) {
        throw 'List is broken';
      }
      list.push(after);
      lastAfter = after;
    }
    return list;
  };

  ValueGroup = function(operation, before, after) {
    var lastAfter, lastBefore, lastNext, lastPrevious, list;
    list = [];
    previous = next = operation;
    lastBefore = lastAfter = operation;
    lastPrevious = lastNext = operation;
    while (previous = previous.$leading) {
      if (previous.$following !== lastBefore)
        break;
      list.unshift(previous);
      if (previous.$parent == operation.$parent) {
        if (previous.$next != lastPrevious)
          throw 'Next pointer is not correct'
        if (lastPrevious.$previous != previous)
          throw 'previous pointer is not correct'

        lastPrevious = previous;
      }
      lastBefore = previous;
    }
    list.push(operation);
    while (next = next.$following) {
      if (next.$leading !== lastAfter)
        break;
      if (next.$parent == operation.$parent) {
        if (next.$previous != lastNext)
          throw 'Previous pointer is not correct'
        if (lastNext.$next != next)
          throw 'next pointer is not correct'

        lastNext = next;
      }
      list.push(next);
      lastAfter = next;
    }
    // validates each subtree (a bit redundant)
    // depth-tree order is specced, so we check all other pointers based on it
    list.forEach(function(node) {
      if (node.$parent) {
        if (node.$parent.$following && node.$parent.$following.$parent == node.$parent) {
          if (node.$parent.$first != node.$parent.$following)
            throw '$first doesnt point properly'

          if (node.$parent.$first.$previous)
            throw '$first also has $previous'
          var follower = node.$parent.$first
          var leader;
          for (var next = node.$parent; next = next.$following;) {
            if (next.$parent == node.$parent) {
              if (follower != next)
                throw 'next pointer is not set properly'
              if (next.$previous != leader) {
                throw 'previous pointer is not set properly'
              }
              var last = next;
              leader = follower
              follower = follower.$next
            }
          }
          if (last.$next)
            throw '$last also has $next'
          if (last && node.$parent.$last != last)
            throw '$last doesnt point properly'
        }
      }
    })
    return list;
  };

  ValueStack = function(operation, before, after) {
    var lastAfter, lastBefore, list;
    list = [];
    before = after = operation;
    lastBefore = lastAfter = operation;
    while (before = before.$preceeding) {
      if (before.$succeeding !== lastBefore) {
        throw 'List of values in the stack is not valid';
      }
      list.unshift(before);
      lastBefore = before;
    }
    list.push(operation);
    while (after = after.$succeeding) {
      if (after.$preceeding !== lastAfter) {
        throw 'List of values in the stack is not valid';
      }
      list.push(after);
      lastAfter = after;
    }
    return list;
  };








